for i in range(num_points):
    for j in range(num_points):
        dx = x_observation[i, j] - x
        dy = y_observation[i, j] - y
        r = np.sqrt(dx**2 + dy**2)

        # Avoid division by zero and handle invalid values
        epsilon = 1e-10
